const conColumn="col-20",expandedColumn="col-100";function imageClick(e){e.preventDefault();let n=this.parentElement.parentElement;if(n.classList.contains(conColumn)){let e=this.parentElement.href;this.src=e,n.classList.add(expandedColumn),n.classList.remove(conColumn)}else n.classList.add(conColumn),n.classList.remove(expandedColumn)}Array.from(document.getElementsByClassName("post-image")).forEach(function(e){e.onclick=imageClick});